sys_variable_value.value:
(function execute(inputs, outputs) {
    var text = "";
    var result = {};
    var ctGR = new GlideRecord("x_ltin2_uw_ai_fso_uw_case");
    ctGR.addQuery('number', inputs.FSOcase);
    ctGR.query();
    if (ctGR.next()) {
        outputs.fso_case = ctGR.getValue('number');
        outputs.appetite_decision = ctGR.getValue('appetite_decision');
        outputs.clearance_status = ctGR.getValue('clearance_decision');
        outputs.customer_id = ctGR.getDisplayValue('customer_id');
       outputs.casesysid = ctGR.getDisplayValue('sys_id');
        //outputs.caller = ctGR.getDisplayValue('caller_id');
        //outputs.assigned_to = ctGR.getDisplayValue('assigned_to');
        //outputs.incident_sys_id = ctGR.getDisplayValue('sys_id');
       

        //var documentId = ctGR.getValue("sys_id");

        // Get journal entry with closing notes
        /*var journalGR = new GlideRecord('sys_journal_field');
        journalGR.addQuery("element_id", documentId);
        journalGR.orderBy("sys_created_on");
        journalGR.query();
        var activity = [];
        while (journalGR.next()) {
            activity.push(journalGR.getValue("value"));
        }
        outputs.incident_activity = activity;*/

    } else {
        outputs.content = "Unable to fetch requested incident record.";
    }
})(inputs, outputs);

